  const text = useSelector((state) => state.text.login);
  const dispatch = useDispatch();


  return (

    <div className='flex flex-col absolute'>
    <Navbar />
    {
        text === true? <Login/> : <Carousel className='carousel'/>
       }




    </div>


  );
}

export default App;
